import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './component/TodoList';

class App extends Conponen {
  constructor() {
    super();
    this.todoItems = [
      'Mua bim bim', 
      'Di da bong', 
      'Di choi'
    ];
  }
  render() {
    return (
    <div className="App">
      <p>
        {
          this.todoItems.map((item) => <TodoList title={item}/>)
        }
      </p>
    </div>
  );
  }
}

export default App;
